import React from 'react';
import './styles/Error.css';

const ErrorPage = () => {
  return (
    <div className="error-container">
      <div className="error-img">
      <div className="error-circle">
        <div className="error-code">404</div>
        <div className="error-text">Страница не найдена</div>
        <br/>
        <div className="error-text">Уважаемый посетитель!</div>
        <div className="error-message">
           Страница, которую вы запросили, отсутствует на сайте.
          Скорее всего страница удалена или вы ошиблись при вводе адреса. 
          Рекомендуем вам перейти на следующие страницы нашего сайта:
        </div>
        <div className="error-links">
          <a href="/">Главная страница</a>
          <a href="/services">Услуги</a>
          <a href="/about">О нас</a>
        </div>
      </div>
      </div>
      
    
    </div>
  );
};

export default ErrorPage;
